const TrendingBar = () => {
    return(
        <div>
            <div className='relative left-3 mt-10 bg-stone-500 h-80 w-52 rounded-xl py-3 px-6'>
                <p className='text-lg font-bold'>trending</p>
            </div>
        </div>
    )
}

export default TrendingBar;
